import React from "react";

const Register = () => {
  return (
    <form>
      <h1 className="h3 mb-3 fw-normal">Register</h1>
      <input className="form-control" required placeholder="Name" />
      <input
        type="email"
        className="form-control"
        placeholder="Email address"
        required
      />

      <input
        type="password"
        className="form-control"
        required
        placeholder="Password"
      />

      <button className="w-100 btn btn-lg btn-primary custom-btn" type="submit">
        Sign in
      </button>
    </form>
  );
};

export default Register;
